INSERT INTO `quotes` (`id`, `author`, `quote`, `created_at`, `updated_at`) VALUES
(1, 'Bill Shankly', 'Es gibt Leute, die denken, FuÃball sei eine Frage von Leben und Tod. Ich mag diese Einstellung nicht. Ich kann Ihnen versichern, dass es noch sehr viel ernster ist.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(2, 'Ruud Gullit', 'Wir hatten wohl 99 Prozent des Spiels. Es waren die anderen drei Prozent, die uns das Spiel gekostet haben.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(3, 'Eduardo Galeano', 'Wenn guter FuÃball passiert, danke ich fÃ¼r das Wunder und es ist mir scheiÃegal, welche Mannschaft oder welches Land spielt.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(4, 'Nelson FalcÃ£o Rodrigues', 'Im FuÃball ist die schlimmste Blindheit, nur den Ball zu sehen.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(5, 'David Seaman', 'Ich denke, ich habe weise gewÃ¤hlt. Als es darauf ankam, wusste ich, dass ich ein besserer Torwart bin als ein Bowler.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(6, 'Anthony Yeboah', 'Ich wollte den Ball treffen, aber der Ball war nicht da.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(7, 'Uwe Seeler', 'Das Geheimnis des FuÃballs ist ja der Ball.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(8, 'Umberto Eco', 'Der FuÃball ist einer der am weitesten verbreiteten religiÃ¶sen Aberglauben unserer Zeit. Er ist heute das wirkliche Opium des Volkes.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(9, 'Toni Polster', 'Ein Denkmal will ich nicht sein, darauf scheissen ja nur die Tauben.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(10, 'Jean-Paul Sartre', 'Bei einem FuÃballspiel verkompliziert sich allerdings alles durch die Anwesenheit der gegnerischen Mannschaft.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(11, 'Deco', 'Wenn ich nicht FuÃballer wÃ¤re, wÃ¼rde ich irgendwas mit FuÃball tun. Vielleicht Zuschauer.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(12, 'Dariusz Wosz', 'Alles hat gestimmt: das Wetter war gut, die Stimmung war gut, der Platz war gut - nur wir waren schlecht.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(13, 'Terry Pratchett', 'Die Sache am FuÃball - das wirklich Wichtige am FuÃball - ist, dass es nicht nur um FuÃball geht.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(14, 'Brian Clough', 'Wir hatten auf dem Papier eine gute Mannschaft. Leider wurde das Spiel auf Rasen gespielt.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(15, 'Vinny Jones', 'Gewinnen spielt eigentlich keine Rolle, solange man gewinnt.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(16, 'Mark Viduka', 'Es wÃ¼rde mich nicht stÃ¶ren, wenn wir jedes Spiel verlieren, solange wir Meister werden.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(17, 'Phil Woosnam', 'Die Regeln des FuÃballs sind sehr einfach: Wenn es sich bewegt, tritt es. Wenn es sich nicht bewegt, tritt es, bis es sich bewegt.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(18, 'Pep Guardiola', 'Wir versuchen immer, bis zum Schluss zu gewinnen. Wenn wir das nicht schaffen, gratulieren wir dem Gegner. Das ist es, worum es im Sport geht.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(19, 'PelÃ©', 'Je schwieriger der Sieg, desto grÃ¶Ãer die Freude Ã¼ber ihn.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(20, 'Cristiano Ronaldo', 'Ich sehe FuÃball als eine Kunst an und alle Spieler sind KÃ¼nstler. Wenn man ein SpitzenkÃ¼nstler ist, ist das Letzte, was man tun wÃ¼rde, ein Bild zu malen, das jemand anderes bereits gemalt hat.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(21, 'Johan Cruyff', 'FuÃball ist einfach, aber es ist schwierig, einfach zu spielen.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(22, 'Vicente del Bosque', 'FÃ¼hrung muss sympathisch, freundschaftlich, herzlich und vor allem emotional sein. Die Mode der autoritÃ¤ren FÃ¼hrung ist vorbei. Beim FuÃball geht es um das Leben. Man kann nicht den ganzen Tag wÃ¼tend sein.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(23, 'Yaya Toure', 'Auf dem Spielfeld und im Leben allgemein behalte ich meine geistige Einstellung bei, indem ich mich daran erinnere, dass ich Teil eines Teams bin, und wenn ich meinen Teil nicht leiste, lasse ich nicht nur mein Team im Stich, sondern alle, die ihm folgen.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(24, 'Johann Cruyff', 'In meinen Teams ist der Angreifer der erste Verteidiger und der Torwart der erste Angreifer.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(25, 'Jose Mourinho', 'Um das ultimative Team zu sein, mÃ¼ssen Sie Ihren KÃ¶rper und Ihren Geist einsetzen. Greifen Sie auf die Ressourcen Ihrer Teamkollegen zurÃ¼ck. WÃ¤hlen Sie Ihre Schritte weise und Sie werden gewinnen. Denken Sie daran, dass nur Teams erfolgreich sind.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(26, 'Alex Morgan', 'Teamkollegen sind entscheidend fÃ¼r Ihren Erfolg. Die RealitÃ¤t ist, egal wie gut Sie sind, Sie kÃ¶nnen nicht punkten, wenn sie Ihnen den Ball nicht zuspielen, Sie kÃ¶nnen nicht gewinnen, wenn sie das andere Team nicht stoppen.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(27, 'Marcello Lippi', 'Es sollte keine Primadonnen in einem Team geben, jeder sollte sich wichtig fÃ¼hlen, vom Ã¤ltesten Spieler bis zum JÃ¼ngsten.', '2021-01-08 17:48:34', '2021-01-08 17:48:34'),
(28, 'Paul Breitner', 'Da kam das ElfmeterschieÃen. Wir hatten alle die Hosen voll, aber bei mir liefÂ´s ganz flÃ¼ssig.', NULL, NULL),
(29, 'Hans Krankl', 'Wir mÃ¼ssen gewinnen, alles andere ist primÃ¤r.', NULL, NULL),
(30, 'Max Merkel', 'Das SchÃ¶nste an Gelsenkirchen war schon immer die Autobahn nach MÃ¼nchen.', NULL, NULL),
(31, 'Max Merkel', 'Im Training habe ich mal die Alkoholiker meiner Mannschaft gegen die Antialkoholiker spielen lassen. Die Alkoholiker gewannen 7:1. Da hab i g\'sagt: Sauft\'s weiter.', NULL, NULL),
(32, 'Franz Beckenbauer', 'Es gibt nur eine MÃ¶glichkeit: Sieg, Niederlage oder Unentschieden.', NULL, NULL),
(33, 'Jens Jeremies', 'Das ist Schnee von morgen.', NULL, NULL),
(34, 'Bastian Schweinsteiger', 'Shanghai hat 22 Millionen Einwohner, so viele gibt es ja in Europa fast nicht.', NULL, NULL),
(35, 'Roman Weidenfeller', 'We have a grandiose Saison gespielt.', NULL, NULL),
(36, 'Andreas Brehme', 'Die Brasilianer sind ja auch alle technisch serviert.', NULL, NULL),
(37, 'Torsten Legat', 'Ich glaube nicht, dass der Verein mir Steine in den Vertrag legt.', NULL, NULL),
(38, 'Roland Wohlfahrt', 'Zwei Chancen, ein Tor: Das nenne ich hundertprozentige Chancenauswertung.', NULL, NULL),
(39, 'Christian Ziege', 'Ich bin der linke, mittlere, defensive Offensivspieler. ', NULL, NULL),
(40, 'Christian Gentner', 'Wir haben keine AuswÃ¤rtsschwÃ¤che, sondern eine ErgebnisschwÃ¤che in AuswÃ¤rtsspielen.', NULL, NULL),
(41, 'Unbekannter Amateur', 'Nur stellen.', NULL, NULL),
(42, 'Unbekannter Amateur', 'Wo ist die Wertsachentasche?', NULL, NULL),
(43, 'Unbekannter Amateur', 'Die haben drei Mann aus der Ersten dabei!', NULL, NULL),
(44, 'Unbekannter Amateur', 'Schiri, wie lange noch?', NULL, NULL),
(45, 'Unbekannter Amateur', 'Sind die Duschen warm?', NULL, NULL),
(46, 'Unbekannter Amateur', 'Wir mÃ¼ssen am Montag noch arbeiten!', NULL, NULL),
(47, 'Unbekannter Amateur', 'Klare BÃ¤lle!', NULL, NULL),
(48, 'Unbekannter Amateur', 'Der kann nichts!', NULL, NULL);
